import React from "react";
import "../../styles/NoFound.css";

function NoFound() {
  return (
    <div className="contentNoFound">
      <h1>No hay publicaciones que coincidan con tu búsqueda.</h1>
      <ul>
        <li>Revisa la ortografía de la palabra.</li> <br />
        <li>Utiliza palabras más genéricas o menos palabras.</li>
        <li>Asegurate que la palabra esté bien escrita</li>
      </ul>
      <p>
        No hay publicaciones que coincidan con tu búsqueda. Revisa la ortografía
        de la palabra. Utiliza palabras más genéricas o menos palabras.
      </p>
    </div>
  );
}

export default NoFound;
